import React from "react";
import masthead from '../../../assets/images/masthead-pic-blur.png';

const InvestmentHead = () => {
  return (
    <div class="masthead-container curve-parent blue-circle">
      <div class="masthead">
        <div class="container">
          <div class="row flex-md-row-reverse align-items-md-center">
            <div data-aos="fade-up" class="col-md-6 col-xxl-7">
              <a
                href="#"
                class="card-image"
                // style={{"backgroundImage": "url(../../../assets/images/masthead-pic-blur.png)"}}
                title="Invest in Mutual Funds Easily"
                data-image-full={masthead}
              >
                {/* <img
                  class="d-block img-fluid"
                  src={masthead}
                  alt="Invest in Mutual Funds Easily"
                /> */}
              </a>
            </div>
            <div data-aos="fade-down" class="col-md-6 col-xxl-5">
              <h1>
                Invest in <span class="highlight-text">Mutual Funds</span>{" "}
                Easily
              </h1>
              <p>
                Algorithmically selected mutual funds to grow your money and
                meet your life goals
              </p>
              <div class="d-grid gap-2 d-md-flex justify-content-md-start">
                <a href="login.html" class="btn btn-primary btn-lg me-md-2">
                  Get Started
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div class="section-bottom-curve"></div>
    </div>
  );
};

export default InvestmentHead;
